const Navbar = () => {
    return (
        <div className="navbar">
            <a href="/"><h1 className="beige">ICONIQUE</h1></a>
            <nav>
                <a href="/reviews/">reviews</a>
                <a href="/about-us/">About Us</a>
            </nav>
        </div>
    );
}

export default Navbar;
